import Card from "react-bootstrap/Card";
const ReviewPane = (reviewData) => {
    console.log(reviewData.reviewData);
    return (
        <div>
            <Card>
                <Card.Body>
                    <Card.Title>{reviewData.reviewData._source.reviewer}</Card.Title>
                    <Card.Text>{reviewData.reviewData._source.comment}</Card.Text>
                </Card.Body>
            </Card>
        </div>
    );
};
export default ReviewPane;
